function ExpenseItem() {
  // Can only return a single element.. trying to return the following gives an error
  /*
    <div>Date</div>
    <div><h2>Title</h2></div>
    <div>Amount</div>
    */
  // Work around #1: Wrap everything into a single <div>
  return (
    <div>
      <div>Date</div>
      <div>
        <h2>Title</h2>
        <div>Amount</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
